import logo from "./logo.svg";
import Canvas from "./Canvas";
import "./App.css";

function App() {
  const canvasSize = 800;

  const chipCoords = [];
  const chipRad = 50;

  for (let i = 100; i < canvasSize - 100; i += (canvasSize - 100) / 4) {
    for (let j = 100; j < canvasSize - 100; j += (canvasSize - 100) / 4) {
      chipCoords.push([i, j]);
    }
  }

  return (
    <div className="App">
      <header className="App-header">
        <Canvas
          canvasSize={canvasSize}
          chipCoords={chipCoords}
          chipRad={chipRad}
        ></Canvas>
      </header>
    </div>
  );
}

export default App;
